            "user.bondedRoles.registration.bondHolderName" to "Имя пользователя держателя облигации",
            "user.bondedRoles.type.SEED_NODE.about.info" to "Сид-узел предоставляет сетевые адреса участников сети для загрузки в сеть Bisq Easy P2P.\nЭто необходимо при первом запуске, так как в этот момент у нового пользователя еще нет сохраненных данных для подключения к другим узлам.\nОн также предоставляет данные P2P сети, такие как сообщения чата, новому подключающемуся пользователю. Эта служба доставки данных также выполняется любым другим узлом сети, однако, поскольку сид-узлы имеют круглосуточную доступность и высокий уровень качества обслуживания, они обеспечивают большую стабильность и лучшую производительность, что приводит к более комфортному процессу загрузки.\nОператоры сид-узлов из Bisq 1 могут стать операторами сид-узлов Bisq Easy без блокировки нового залога BSQ.",
